import Chart from "react-apexcharts";
import Jumbotron from 'react-bootstrap/Jumbotron'
import { Dropdown,Col,Container,Image,Button,ButtonGroup } from 'react-bootstrap';
import { green } from "color-name";

class Login extends Component {
    render(){
        return(
            <Jumbotron fluid style={{borderColor:"red"}}>
               <Container className="container p-3 my-3 bg-primary text-white rounded" >
               <Col xs={6} md={4}>
      <Image src="image/amit1.jpg" rounded />
    </Col>
    <p>
      This is a modified jumbotron that occupies the entire horizontal space of
      its parent.
    </p>
  </Container>
</Jumbotron>
        );
    }

}
export default Login;
